import React from 'react';
import "../styles/login_form.css";
import brand_logo from '../images/brand_logo.svg';
import axios from 'axios';


function LoginForm(props){
    

    let login = (event) => {
        event.preventDefault();

    }

    return(
        <div id="form-container">
            <form method="POST" id="login-form" onSubmit={login}>
                <img src={brand_logo} alt="Brand Logo" id="form-brand-logo" />
                
                <div id="input-container">
                    <input type="email" id="email" name="email" placeholder="Email" />
                    <input type="password" name="password" id="password1" placeholder="Password" />
                </div>
            
                <button type="submit" id="login-button">Log in</button>

                <div id="signup">
                    <p>Don't have a account</p>
                    <a href="{% url 'register' %}">Sign Up</a>
                </div>
            
            </form>
        </div>
    );
}

export default LoginForm;
